/*Table structure for table `sys_log` */

CREATE TABLE `sys_log` (
  `log_id` varchar(32) NOT NULL COMMENT '日志ID',
  `log_source` varchar(50) NOT NULL COMMENT '日志来源',
  `log_type` varchar(50) NOT NULL COMMENT '日志类型',
  `log_time` datetime NOT NULL COMMENT '日志时间',
  `log_content` varchar(4000) NOT NULL COMMENT '日志内容',
  `request_url` varchar(100) DEFAULT NULL COMMENT '请求URL',
  `username` varchar(30) DEFAULT NULL COMMENT '用户名',
  `attribute1` varchar(1000) DEFAULT NULL,
  `attribute2` varchar(1000) DEFAULT NULL,
  `attribute3` varchar(1000) DEFAULT NULL,
  `attribute4` varchar(1000) DEFAULT NULL,
  `attribute5` varchar(1000) DEFAULT NULL,
  `attribute6` varchar(1000) DEFAULT NULL,
  `attribute7` varchar(1000) DEFAULT NULL,
  `attribute8` varchar(1000) DEFAULT NULL,
  `attribute9` varchar(1000) DEFAULT NULL,
  `attribute10` varchar(1000) DEFAULT NULL,
  PRIMARY KEY (`log_id`),
  KEY `SYS_LOG_N1` (`log_source`),
  KEY `SYS_LOG_N2` (`log_type`),
  KEY `SYS_LOG_N3` (`log_time`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统日志';

