  `create_date` datetime NOT NULL COMMENT '创建日期',
  `last_update_date` datetime NOT NULL COMMENT '最后更新日期',
  `attribute1` varchar(100) DEFAULT NULL,
  `attribute2` varchar(100) DEFAULT NULL,
  `attribute3` varchar(100) DEFAULT NULL,
